import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import PageHero from './components/PageHero';
import AboutUs from './components/AboutUs';
import MissionScroller from './components/MissionScroller';
import OurGuarantees from './components/OurGuarantees';

function App() {
  return (
   <div className="mountRoot">
      <div classNme="gyanContainer">
        <img alt="Gradient beams background image" width="2610" height="1305" decoding="async" data-nimg="1" class="absolute -top-[1rem] left-1/2 z-0 -ml-[40rem] w-[163.125rem] max-w-none opacity-40 sm:-ml-[67.5rem]" srcset="https://wsrv.nl/?url=https%3A%2F%2Fcodedamn.com%2Fassets%2Flanding-page-assets%2Fbeams.jpeg&amp;w=2610&amp;q=70&amp;output=webp 1x" src="https://wsrv.nl/?url=https%3A%2F%2Fcodedamn.com%2Fassets%2Flanding-page-assets%2Fbeams.jpeg&amp;w=2610&amp;q=70&amp;output=webp" />
        <Header />
        <PageHero />
        <AboutUs />
        <MissionScroller />
        <OurGuarantees />
      </div>
   </div>
  );
}

export default App;
